import React, { useState } from 'react';
import { Navbar, Nav, NavDropdown, Container, Button } from 'react-bootstrap';
import '../Navbar.css';


const CustomNavbar = () => {
  const [expanded, setExpanded] = useState(false);

  return (
    <div className="text-white">
      <Navbar expanded={expanded} expand="lg" className="navbar navbar-text-white" variant="">
        <Container>
          <Navbar.Brand href="#home">Brand Name</Navbar.Brand>
          <Navbar.Toggle 
            aria-controls="basic-navbar-nav" 
            onClick={() => setExpanded(expanded ? false : "expanded")}
          />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#about-us">About Us</Nav.Link>
              <Nav.Link href="#contact">Contact Us</Nav.Link>
              {/* Add more navigation links here */}
              {/* Example of a dropdown */}
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Cats</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Dogs</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Birds</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Fish</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Accessories</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">Pet Foods</NavDropdown.Item>
                            {/* More dropdown items */}
              </NavDropdown>
            </Nav>
            <Button variant="outline-primary">Login</Button>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
};


export default CustomNavbar;
